CREATE TABLE `bornes_incendie`
(
    insee VARCHAR(250),
    id VARCHAR(250) PRIMARY KEY,
    type VARCHAR(250),
    nature VARCHAR(250),
    statut VARCHAR(250),
    adresse VARCHAR(250),
    pression VARCHAR(250),
    debit VARCHAR(250),
    volume VARCHAR(250),
    disponible VARCHAR(250),
    anomalies VARCHAR(250),
    diametre VARCHAR(250),
    remarque VARCHAR(250),
    date_maj VARCHAR(250),
    lon VARCHAR(250),
    lat VARCHAR(250)
);

